// frontend/src/UserForm.js
import React, { useState, useEffect } from 'react';
import axios from 'axios';
import { io } from 'socket.io-client';
import FriendList from './FriendList'; // FriendListをインポート
import FriendCard from './FriendCard'; // FriendCardをインポート

const socket = io('http://localhost:5000');

function UserForm({ addFriend }) {
  const [name, setName] = useState('');
  const [hometown, setHometown] = useState('');
  const [mbti, setMbti] = useState('');
  const [hobby, setHobby] = useState('');
  const [favoriteFood, setFavoriteFood] = useState('');
  const [friends, setFriends] = useState([]); // 友達リストの状態を追加
  const [showCard, setShowCard] = useState(false);
  const [selectedFriend, setSelectedFriend] = useState(null);

  useEffect(() => {
    socket.on('connect', () => {
      console.log('サーバーに接続しました');
    });
    socket.on('userJoined', (userData) => {
      console.log(`${userData.name}さんが参加しました`);
    });
    return () => {
      socket.disconnect();
    };
  }, []);

  const handleSubmit = async (e) => {
    e.preventDefault();
    const friendData = { name, hometown, mbti, hobby, favoriteFood };
    try {
      const response = await axios.post('http://localhost:5000/api/users', friendData);
      console.log('ユーザーが作成されました:', response.data);
      socket.emit('join', response.data);
      addFriend(friendData); // 友達を追加
      setFriends((prev) => [...prev, friendData]); // 友達リストに追加
    } catch (error) {
      console.error('ユーザーの作成に失敗しました:', error);
    }
  };

  const handleShowCard = (friend) => {
    setSelectedFriend(friend); // 選択した友達を設定
    setShowCard(true); // 名刺を表示
  };

  const handleCloseCard = () => {
    setShowCard(false);
    setSelectedFriend(null);
  };

  return (
    <div>
      <form onSubmit={handleSubmit}>
        <div>
          <label>名前:</label>
          <input type="text" value={name} onChange={(e) => setName(e.target.value)} required />
        </div>
        <div>
          <label>出身地:</label>
          <select value={hometown} onChange={(e) => setHometown(e.target.value)} required>
            <option value="">選択してください</option>
            <option value="東京">東京</option>
            <option value="大阪">大阪</option>
            <option value="愛知">愛知</option>
            <option value="福岡">福岡</option>
            <option value="北海道">北海道</option>
            <option value="宮城">宮城</option>
            <option value="広島">広島</option>
          </select>
        </div>
        <div>
          <label>MBTIタイプ:</label>
          <input type="text" value={mbti} onChange={(e) => setMbti(e.target.value)} required />
        </div>
        <div>
          <label>趣味:</label>
          <select value={hobby} onChange={(e) => setHobby(e.target.value)} required>
            <option value="">選択してください</option>
            <option value="アウトドア">アウトドア</option>
            <option value="インドア">インドア</option>
          </select>
        </div>
        <div>
          <label>好きな食べ物:</label>
          <select value={favoriteFood} onChange={(e) => setFavoriteFood(e.target.value)} required>
            <option value="">選択してください</option>
            <option value="焼肉">焼肉</option>
            <option value="寿司">寿司</option>
            <option value="お好み焼き">お好み焼き</option>
          </select>
        </div>
        <button type="submit">送信</button>
      </form>
      <FriendList friends={friends} onShowCard={handleShowCard} /> {/* FriendListを表示 */}
      {showCard && selectedFriend && (
        <FriendCard friend={selectedFriend} onClose={handleCloseCard} />
      )}
    </div>
  );
}

export default UserForm;
